import React, { useEffect, useState } from 'react';
import './App.css';
import MainView from './component/MainView';
import LeftPanel from './component/LeftPanel';
import 'bootstrap-icons/font/bootstrap-icons.css';
import Resource from './component/Resource';
import HomePage from './component/HomePage';

function App() {
  const [view, setView] = useState(0);

  const renderPage = () => {
    console.log('###', view);
    if (view == 0) {
      console.log("Checked");
      <HomePage />
    }
    if (view == 2) {
      console.log("Checked 3");
      <Resource />
    }
  }

  useEffect(() => {
    console.log("actually clicked");
    renderPage();
  }, [view]);

  return (
    <>
      <div className="sidenav">
        <p onClick={() => setView(0)}><a href="#"><i className="bi bi-house"></i> Home</a></p>
        <p onClick={() => setView(1)}><a href="#"><i className="bi bi-alarm"></i> My products and flightpaths</a></p>
        <p onClick={() => setView(2)}><a href="#"><i className="bi bi-heart"></i> Resources</a></p>
        <HomePage />
      </div>
      <div>
        renderPage();
      </div>
    </>
  );
}

export default App;
